/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="-">预算项目</h1>\n<p>预算项目期望通过提供服务来从区块链获得奖金的工作项目提案。一项提案包含至少以下信息：</p>\n<ul>\n<li>开始和结束时间</li>\n<li>每日支付预算</li>\n<li>预算上限</li>\n</ul>\n<p>它还应该包含一个指向网页或论坛帖子的链接，以详细介绍工作项目内容。</p>\n<p>针对预算项目，投票人可以选择支持或者反对。</p>\n<h2 id="-">预算项目支付机制</h2>\n<p>预算项目每天收到的金额来自一个金额固定的每日预算池，根据票数多寡排序进行分配，知道每日预算池中资金耗尽。举一个例子：</p>\n<ul>\n<li>每日预算池总额为400K CYB</li>\n<li>有5个预算项目符合条件（支持票多余反对票）,他们都要求每天获得100K CYB的预算支持。</li>\n</ul>\n<p>那么得票较多的4个项目将每天获得100K CYB的支付，但是由于付完这4各项目，每日预算池中已无资金剩余，那么第五个项目受付金额则为0。</p>\n'},
/*!*****************************************!*\
  !*** ./help/zh/introduction/witness.md ***!
  \*****************************************/
/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="-">见证人</h1>\n<p>见证人是为区块链打包生成新的区块的实体。每一个见证人由股东批准，打包经验证的交易，生成并签署区块。每一条进入网络的交易最终将被所有见证人验证。</p>\n<h2 id="-">共识机制</h2>\n<p>由谁在什么时间来<em>打包生成</em>区块是由被称为<em>Delegated Proof of Stak (DPOS)</em>的共识算法决定的。算法的本质是 Cybex 的股东(CYB的持有者)能通过投票来决定他们期望的块打包者。由获得最多票数的所谓&quot;见证人&quot;来打包生成区块。</p>\n'},
/*!*****************************************!*\
  !*** ./help/zh/introduction/wallets.md ***!
  \*****************************************/
/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="-">钱包软件</h1>\n<p>你或许已经注意到，本应用是一个基于web的应用软件，在浏览器中运行。通过与一个受信任的节点连接来获得整个生态系统的接入。</p>\n<h2 id="-">钱包安全性</h2>\n<p>你可以确信的是我们的服务器永远不会也不能访问你的资产。你的私钥不会离开你的本地浏览器。它们使用你的密码进行加密后保存在本地浏览器的数据库中。因此，你只需要确保你已经<a href="../introduction/backups.md">备份</a>了钱包，就不用担心由于计算机失灵或者浏览器奔溃导致钱包数据丢失。</p>\n<h2 id="-">钱包管理</h2>\n<p>钱包系统的用户界面允许你使用多个独立的钱包，每个钱包可能包含相互独立的账户和资金。你可以通过<code>设置-&gt;钱包</code>菜单进行创建、备份和切换钱包的操作。</p>\n'},
