/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h2 id="-">桥接及网关服务</h2>\n<p>桥接和网关服务帮助用户进行数字资产的充值和提现活动。但这两种服务模式有些不同。</p>\n<h3 id="-">桥接: 无需信任的模式</h3>\n<p>桥接服务运行用户存入一定数量的CYB以外的数字货币(资产)，并获得相应的智能锚定货币(SmartCoin)。锚定货币没有对手方风险。所以这种模式下，用户面对的风险仅在于充值期间一小段时间的风险。这相对于比中心化的交易所的充值方式安全得多，因为中心化交易所总是面临各种黑客攻击或者其他管理漏洞而导致丢币的风险。</p>\n<h3 id="-">网关: 需要信任的模式</h3>\n<p>网关模式下基本上就和传统的交易所运作模式相似，依赖于交易所的偿付能力。网关发行资产，一般以网关品牌作为前缀，比如OPEN，TRADE或是META。这些资产由用户存入网关的对真实应资产背书，比如BTC，ETH等。</p>\n<p>OPEN.BTC理论上和你充值到一般中心化交易所，比如Poloniex的BTC一样，可以记作POLO.BTC。你都将依赖网关对你的数字资产进行兑付。</p>\n'},
