/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="graphene-">Graphene 石墨烯</h1>\n<p>Cybex是一个金融智能合约平台，该平台基于<a href="http://cryptonomex.com">Cryptonomex</a>公司研发的<a href="https://github.com/cryptonomex/graphene">Graphene(石墨烯)</a>技术开发。Graphene(石墨烯)是一个开发工具包，同时也是实时区块链的技术实现。</p>\n<p>本帮助文档旨在提供用户一个系统概述，并解释系统中的一些基本概念。</p>\n<h2 id="-">简介</h2>\n<ul>\n<li><a href="introduction/cybex.md">Cybex</a></li>\n<li><a href="introduction/wallets.md">钱包</a></li>\n<li><a href="introduction/backups.md">备份</a></li>\n<li><a href="introduction/blockchain.md">区块链</a></li>\n<li><a href="introduction/witness.md">见证人</a></li>\n<li><a href="introduction/workers.md">预算项目</a></li>\n<li><a href="introduction/committee.md">理事会</a></li>\n</ul>\n<h2 id="-">账户</h2>\n<ul>\n<li><a href="accounts/general.md">介绍</a></li>\n<li><a href="accounts/permissions.md">权限</a></li>\n<li><a href="accounts/membership.md">会员级别</a></li>\n</ul>\n<h2 id="-">资产</h2>\n<ul>\n<li><a href="assets/mpa.md">市场锚定资产</a></li>\n<li><a href="assets/uia.md">用户发行资产</a></li>\n<li><a href="assets/privbitassets.md">私有比特资产</a></li>\n</ul>\n<h2 id="-">去中心化交易所</h2>\n<ul>\n<li><a href="dex/introduction.md">介绍</a></li>\n<li><a href="dex/trading.md">交易</a></li>\n<li><a href="dex/shorting.md">卖空比特资产</a></li>\n</ul>\n<hr>\n<p><a href="glossary.md">词汇表</a></p>\n'},
