/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="-">交易</h1>\n<p>文本将介绍在Cybex DEX去中心化交易所系统中使用的一些术语，以及交易对的呈现方式。</p>\n<h2 id="-">交易对</h2>\n<p>在Cybex系统中，任何资产之间都可相互交易。我们选取任意2种资产，它们就形成了<em>市场交易对</em>。比如，我们可以使用美元USD与欧元EUR在USD:EUR交易对市场中进行交易。</p>\n<p>为了与外汇交易习惯统一，交易对中的资产标准化为 <em>基础资产</em> 和 <em>报价资产</em>，表现形式如下：</p>\n<pre><code>*报价资产* : *基础资产*</code></pre><p>比如<em>基础资产</em>为USD和<em>报价资产</em>为EUR的交易对表现为EUR:USD。</p>\n<h2 id="-">买卖盘</h2>\n<p>买卖盘由<em>买盘</em>和<em>卖盘</em>构成。由于交易对并无固定的顺序，所以可以进行反转，下表展示了买盘和卖盘对应的资产买、卖操作：</p>\n<table>\n<thead>\n<tr>\n<th>方向</th>\n<th>卖</th>\n<th>买</th>\n</tr>\n</thead>\n<tbody><tr>\n<td>买</td>\n<td><em>报价资产</em></td>\n<td><em>基础资产</em></td>\n</tr>\n<tr>\n<td>卖</td>\n<td><em>基础资产</em></td>\n<td><em>报价资产</em></td>\n</tr>\n<tr>\n<td>--------</td>\n<td>---------</td>\n<td>---------</td>\n</tr>\n</tbody></table>\n<p>显然在 USD:EUR 交易对的买方即为 EUR:USD 交易对的卖方。价格在系统内部自动转换，在交易对反转时也能正确转换。</p>\n<h2 id="-">交易</h2>\n<p>下单时，需要填写<em>买单</em>或<em>卖单</em>表单（对应希望的<em>买入</em>或<em>卖出</em>）。你需要填写打算买入或卖出的<em>价格</em>和<em>数量</em>。订单总额将自动计算。下单时可能需要支付额外的手续费。</p>\n<p>一旦订单被撮合（比如你的订单被其他人接受），你的账户将存入相应的资产。</p>\n<p>未撮合订单可随时取消。</p>\n'},
