/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="-">卖空比特资产</h1>\n<p>为了看多CYB，并且为比特资产，比如USD, EUR, GOLD等提供市场深度，你可以从网络<em>借入</em>比特资产，并且<em>卖出</em>。我们来介绍下相关步骤。</p>\n<h2 id="-">借入</h2>\n<p>Cybex网络能够发行比特资产，并借给用户，只要用户能够提供足够的抵押担保。</p>\n<ul>\n<li><em>喂价</em>: 在外部交易所中1CYB的交易价格</li>\n<li><em>维持保证金比率</em> (MCR): 由见证人维护并调节的起始抵押比率</li>\n<li><em>最大强制平仓比率</em> (MSQR): 由见证人维护并调节的最大强制平仓比率以保护空头围堵。</li>\n<li><em>强制平仓保护价</em> (SQP): 指定一个空头头寸被强制平仓支付最多时的价格</li>\n<li><em>强制平仓价</em> (CP): 将触发空头/贷款头寸强制平仓的价格</li>\n</ul>\n<h3 id="-">强制平仓</h3>\n<p>Cybex网络可以强制平仓那些抵押不足的空头仓位。任何时候，如果空头仓位抵押物的市场最高买价低于<em>强制平仓价(CP)</em>，且高于<em>强制平仓保护价(SQP)</em>时将触发强制平仓，空头仓位将被强制卖出抵押物。</p>\n<pre><code>SQP = 喂价 / MSQR\nCP = 债务价值 / 抵押物价值 * MCR</code></pre><p>强制平仓发生时，将用抵押物按市场价格（最高到SQP价格）买入之前接入的比特资产，进行平仓。剩余的抵押CYB将会归还用户。</p>\n<h3 id="-">清算</h3>\n<p>比特资产的持有人可以随时要求按<em>公允价格</em>进行清算。清算发生时将关闭抵押率最低的空头/借贷头寸，卖出抵押物已完成清算。</p>\n<h2 id="-">卖出</h2>\n<p>借入比特资产后，用户可以随时在市场上以自己意愿的价格卖出。卖出后，用户即实现了卖空该比特资产的目的。</p>\n<h2 id="-">更新抵押率</h2>\n<p>任何时间，持有空头/借贷头寸的用户可以修改抵押率来灵活地适应市场变化。如果调高抵押率，则额外的CYB将被锁定以增加抵押，而调低抵押率则要求用户返还网络相应差额数量的比特资产。</p>\n<h2 id="-">平仓</h2>\n<p>空头/借贷头寸平仓时，用户必须持有相应借入的比特资产，以返还网络。网络将相应数量的比特资产从流通供给中去除，并解锁抵押物返还用户账户。</p>\n'},
