/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="dex-">DEX去中心化交易所简介</h1>\n<p>Cybex 去中心化交易所（简称<em>DEX</em>）允许用户在Cybex系统中直接进行数字商品的交易。</p>\n<p>去中心化交易所相对于传统的中心化交易所拥有很多优势，文档中对其中一些特性进行简单介绍。Cybex DEX拥有的众多特性，用户可以根据自身需求来选择利用全部或者部分功能。</p>\n<ul>\n<li><strong>权力分离</strong>: \n由同一个实体来发行资产（IOU）和处理订单是不合理，也是不必要的。在Cybex系统中，订单撮合是由网络协议执行，并不关心相关资产的内涵。</li>\n<li><strong>全球整合的买卖盘</strong>:\n全世界任何人只要能访问互联网就能访问Cybex，并使用DEX进行交易。这使得全球的流动性汇聚到同一个去中心化的买卖盘市场。</li>\n<li><strong>交易几乎任何标的</strong>:\nCybex DEX可交易的资产是不受限的。你可以交易<strong>任何</strong>交易对。尽管有些交易对市场深度可能很低，比如白银:黄金（SILVER:GOLD），而有些交易对则会非常活跃，交易量很大，比如外汇交易美元:欧元（USD:EUR）。</li>\n<li><strong>乐趣无限</strong>:\nCybex协议将无法限制你的交易体验。</li>\n<li><strong>去中心化</strong>:\nDEX在全球都是去中心化的。这不仅意味着不存在单点失败，而且Cybex交易所全年无休，7/24开放交易，因为任何时间，在世界上总有一个地方是白天交易时间。</li>\n<li><strong>安全性</strong>:\n你的资金和交易订单都由工业级别的椭圆曲线加密算法进行加密保护。没有人能够在未经你许可的情况下访问这些信息。我们还为用户提供了担保和多重签名机制进一步提高安全性。</li>\n<li><strong>快捷</strong>:\n与其他去中心化网络相比，Cybex DEX可以实现实时交易，速度仅受制于光速和地球的大小。</li>\n<li><strong>可自证的订单撮合算法</strong>:\n使Cybex DEX独一无二的是可自证的订单撮合算法。给定的一组交易订单，你总是可以验证这些订单是被正确的撮合，而不存在欺诈。</li>\n<li><strong>抵押担保的智能资产（Smartcoins）</strong>:\nCybex一个最重要的特性是<em>智能资产（smartcoins）</em>，比如比特美元（bitUSD）、比特欧元（bitEUR）、比特人民币（bitCNY）等等。为了方便起见，系统中这些资产直接已美元（USD），欧元（EUR），人民币（CNY）表示。这些数字资产代表其对应物理货币的价值。钱包中的1比特美元等价于$1，可自由兑换。这些数字资产由Cybex公司股份（CYB）冻结抵押进行担保，并可按市价进行清算。</li>\n</ul>\n'},
