/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="-">私有比特资产</h1>\n<p>通过私有比特资产，某些用户可以发行市场锚地资产，然后并不依赖见证人发布的喂价信息。相反的，在创建<em>私有比特资产</em>时，发行人设定一组授权账号来发布喂价信息。发行人可以设置与该资产相关的各种费率参数。</p>\n<p>这个特性主要适用于一些中心化交易所和机构，它们往往能够获得实时的价格信息，并以此来增加交易量。</p>\n'},
/*!*******************************!*\
  !*** ./help/zh/assets/mpa.md ***!
  \*******************************/
/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="-">市场锚定资产</h1>\n<p>一种加密数字货币，拥有类似比特币的属性和优点，同时能保持价格与对应的全球接受的货币同步(比如美元)。具有很强的便利性和实用性，对管制免疫。Cybex的市场锚定资产(MPA)可以实现这样的目的。市场锚定资产是一种新型的可自由交易的数字资产，通过差价合约(CFD)机制，它的价值能够追踪传统的对应资产的价值。</p>\n<p><em>SmartCoin</em> (市场锚定资产的另一种叫法)是一种数字货币，它的价值<em>总是</em>有100%或更多价值的Cybex核心货币(CYB)来支撑。这些CYB在差价合约(CFD)中，作为抵押物存在，并在任何时间可被赎回。</p>\n<p>市场锚定资产与众不同的一个特点在于，尽管它使用了有抵押的价差合约，它却能免于对手盘风险。这是由网络本身(软件协议)通过确保抵押充足，并在特定情况下进行强制清算的机制来实现的。</p>\n<p>以下是部分已经可用的市场锚定资产</p>\n<ul>\n<li>BitUSD (比特美元)</li>\n<li>BitCNY (比特人民币)</li>\n<li>BitEUR (比特欧元)</li>\n<li>BitGOLD (比特黄金)</li>\n<li>...</li>\n</ul>\n'},
