/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="-">会员级别</h1>\n<p>Cybex 系统中，用户账户分为3个种类。我们运行用户升级账户到类似VIP的会员级别，享受费率折扣以及其他专属特性。</p>\n<h2 id="-">非会员(普通账户)</h2>\n<p>一个<em>非会员账户</em>，也就是一个<em>普通账户</em></p>\n<h2 id="-">终身会员</h2>\n<p>终身会员账户可以从自己支付的各种手续费中获得一定比例的返现奖励，并有资格加入引荐计划，通过引荐或注册用户获得引荐奖励。升级到终身会员要求支付一笔一次性的升级费用，具体金额由理事会成员通过投票设定和调整。</p>\n<h2 id="-">年度会员</h2>\n<p>如果你暂时不想成为终身会员，那么你还可以选择升级到年度会员，也可获得一定比例的手续费返现。升级到年度会员，每年需要花费较少数量的会员费用。</p>\n<h3 id="-">手续费分配</h3>\n<p>每次你推荐的用户支付手续费时，该手续费将分配给多个不同账户。网络、推荐人都将获得一部分分成。</p>\n<p>注册人是账户注册时代其支付注册费的账户。注册人账户可自行决定剩余的手续费如何在它自己及它的市场合作方之间分配。</p>\n<h4 id="-">待结费用</h4>\n<p>手续费每个维护周期在网络、推荐人和注册人之间结算一次。尚未结算的手续费称为<em>待结费用</em>。</p>\n<h4 id="-">待解冻金额</h4>\n<p>大部分获取手续费的利益账户可立即使用资金，但金额超过一定数量的费用(比如支付升级终身会员的手续费、注册高级账户名的手续费等)则需要暂时冻结，并在一段时间内线性解冻释放。</p>\n'},
