/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="tan-k">Tanık</h1>\n<p>Tanıklar yeni bloklar inşa etmek suretiyle blokzincirine çalışan kimselerdir.\nHer tanık, hissedarlar tarafından onaylanır ve tasdikli işlemlerden bloklar inşaa eder \nve imzalar. Ağın içinde gerçekleşen her işlem en sonunda tüm tanıklar tarafından \ntasdik  edilmek zorundadır.</p>\n<h2 id="mutabakat-mekanizmas-">Mutabakat Mekanizması</h2>\n<p>Kimin tam olarak hangi anda blok <em>ürettiği</em> , <em>Delegated Proof of Stake</em> \n(Yetkilendirilmiş-vekil-pay-ispatı) denilen mutabakat mekanizmasıyla belirlenir. \nEsasında, Cybex hissedarları (elinde CYB kuponu olan)  tercih edilen blok \nüreticilerine blokzincirinde oy verebilirler. O <em>tanıklar</em> adı verilen, en çok oyu alan \nkimselerin blokları üretmelerine müsade edilir.</p>\n'},
