/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="blokzinciri">Blokzinciri</h1>\n<p>Graphene de çoğu kripto para gibi , transferler ve piyasa hareketleriyle\nilgili katılımcıları haberdar  etmek için blokzincirinden  faydalanır.\nHer blok bir önceki bloğu kaynak olarak gösterdiği için ağda daha önceden \ngerçekleşmiş tüm işlemleri içeren bir bloklar zinciri (blokzinciri) elde ederiz . Blokzinciri\naçık ve erişilebilir ve denetlenebilir bir defteri-kebir olduğundan , herkes transferlere,\n piyasa emirlerine ve sipariş defterlerine yakından  bakabilir ve teyit edebilir.</p>\n<p> Tabii ki, bu web cüzdanı denetlemelerinize yardımcı olması için size bir blok \naraştırıcısı da sunmaktadır.</p>\n<h2 id="mutabakat-mekanizmas-">Mutabakat Mekanizması</h2>\n<p>Hangi anda ve kimin blok <em>üretmeye</em> izni olduğu  , <em>Delegated Proof of Stake</em> \n(Yetkilendirilmiş-vekil-pay-ispatı) denilen mutabakat mekanizmasıyla belirlenir. \nEsasında, Cybex hissedarları (elinde CYB kuponu olan)  tercih ettikleri blok \nüreticilerine blokzincirinde oy verebilirler.  En çok oyu alan o <em>tanıklar</em>ın\nblokları üretmelerine izin verilir.</p>\n<h2 id="i-lemler">İşlemler</h2>\n<p>Graphene blokzinciri teknolojisi çeşitli işlem türleri sunmaktadır.  Kullanıcılar \naralarında aktiif transferleri yapabildikleri gibi dağıtık borsayla ilişkili \nişlemler de vardır. Bu işlem türlerinin bir çoğu kendini izah eden \nfişlerle etiketlenmişlerdir, diğer işlemler ise şirketin iç işleriyle alakalı daha çok \nbilgi gerektirir.</p>\n'},
