/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="graphene-yard-m">Graphene Yardım</h1>\n<p>Cybex, <a href="http://cryptonomex.com">Cryptonomex</a> tarafından inşa edilmiş olan\n<a href="https://github.com/cryptonomex/graphene">Graphene</a> teknolojisine dayanan bir \nFinansal-Akıllı-Kontratlar platformudur. Graphene&#39;i  gerçek-zamanlı blokzincirleri için \nbir araç takımı yada bir teknoloji olarak da görebilirsiniz.</p>\n<p>Bu yardım bölümü özet bir genel bakış sağlar ve bu uygulamanın en temel \nkavramlarını tanımlar.</p>\n<h2 id="takdim">Takdim</h2>\n<ul>\n<li><a href="introduction/cybex.md">Cybex</a></li>\n<li><a href="introduction/wallets.md">Cüzdan</a></li>\n<li><a href="introduction/backups.md">Yedekler</a></li>\n<li><a href="introduction/blockchain.md">Blokzinciri</a></li>\n<li><a href="introduction/witness.md">Tanıklar</a></li>\n<li><a href="introduction/workers.md">İşçiler</a></li>\n<li><a href="introduction/committee.md">Kurul Üyeleri</a></li>\n</ul>\n<h2 id="hesaplar">Hesaplar</h2>\n<ul>\n<li><a href="accounts/general.md">Giriş</a></li>\n<li><a href="accounts/permissions.md">İzinler</a></li>\n<li><a href="accounts/membership.md">Üyelikler</a></li>\n</ul>\n<h2 id="aktifler">Aktifler</h2>\n<ul>\n<li><a href="assets/mpa.md">Piyasa Sabitli Varlıklar</a> (BitUSD, BitEUR, BitGOLD, Bit*,...)</li>\n<li><a href="assets/uia.md">Kullanıcı Aktifleri</a></li>\n<li><a href="assets/privbitassets.md">Özelleştirilmiş Varlıklar</a></li>\n</ul>\n<h2 id="merkezsiz-da-t-k-borsa">Merkezsiz/Dağıtık Borsa</h2>\n<ul>\n<li><a href="dex/introduction.md">Giriş</a></li>\n<li><a href="dex/trading.md">Alış/Satış</a></li>\n<li><a href="dex/shorting.md">BitAktif Kısa Satışları</a></li>\n</ul>\n<hr>\n<p><a href="glossary.md">Terimler</a></p>\n'},
