/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="giri-">Giriş</h1>\n<p>Merkezsiz borsa (kısaca <em>DEX</em>) , Cybex ekosisteminde \nalıp-satılan dijital mamüllerin doğrudan takas edilebilmelerini sağlar.</p>\n<p>Merkezsiz bir borsanın , bariz geleneksel borsalardan bir takım avantajları vardır. \nBunlardan kısaca bahsetmek istiyoruz. Cybex DEX&#39;de hepsi mevcut olmasina \nrağmen o özellikleri tamamen ya da kısmen layığı ile kullanabilmek okuyucuya ve \nmüşteriye kalmıştır.</p>\n<ul>\n<li><strong>Güçler Ayrılığı</strong> : \nIOU &#39;lari piyasaya sürme  ve sipariş defterlerine işleme görevinden aynı \nkimsenin sorumlu olmasını gerektirecek bir sebep yoktur. Cybex&#39;de işlem \nemirlerin eşleştirilmesi işi protokol tarafından yürütülür, protokolün \nişlemlere konu olan aktiflerle ilgili bilgisi yoktur, sadece işlem görür.</li>\n<li><strong>Genel Birleşik Emir/Sipariş Defteri</strong> :\nCybex evrensel olduğu için , internet erişimi olan herkes  DEX&#39;i alım-satım için \nkullanabilir. Bu, dünyanın likiditesini , merkezsiz/dağıtık alım-satım için tek bir emir \ndefterine getirir.</li>\n<li><strong>Neredeyse Herşeyi Alıp-Satabilirsiniz</strong> :\nCybex DEX varlığın muhteviyatını bilmez , dolayısı ile <strong>her türlü</strong>  eşleşme ticareti \nyapılabilir. GÜMÜŞ:ALTIN gibi bazı eşleşmeler  az likidite sağlarken FOREX ticareti \niçin USD:EUR gibi eşleşmeler çok büyük hacimli işlem görür.</li>\n<li><strong>Limit Yok</strong> :\nCybex protokolünün sizin ticaret deneyiminizi sınırlaması mümkün değildir.</li>\n<li><strong>Merkezsiz</strong> :\nDEX (merkezsiz borsa) tüm dünyaya dağıtıktır. Bölece tek kırılma noktası \nolmadığı gibi bu Cybex borsasının ticaret için 7/24 açık olduğu anlamına \ngelir, çünkü her zaman dünyada bir yerde vakit mutlaka gündüzdür. </li>\n<li><strong>Güvenli</strong> :\nFonlarınız ve ticari işlemleriniz endüstriyel seviyedeki eliptik-eğri kriptografisiyle tamamen güvence altındadır. \n Kimse siz izin vermedikçe fonlarınıza erişemez.\nGüvenliği daha da güçlendirmek amacıyla müşterilerimize emanet-escrow ve çoklu-\nimza planları düzenlemelerine imkan tanıyoruz.</li>\n<li><strong>Hızlı</strong> :\nDiğer merkezsiz ağların tersine Cybex DEX gerçek-zamanlı ticarete\n imkan tanır , sadece ışık hızı ve gezegenin büyüklüğü \nile sınırlıdır.</li>\n<li><strong>Kanıtlanabilir Emir Eşleştirme Algoritması</strong> :\nCybex DEX i nadir kılan şeylerden biri de ispatlanabilir emir eşleştirme \nalgoritmasıdır.  Verilen bir takım işlem-emri  için her zaman bu emirlerin \nkanıtlanabilir şekilde eşleştirilmiş olduğunu teyit edebilirsiniz.</li>\n<li><strong>Teminata Bağlanmış</strong> :\nCybex&#39;in en büyük özelliklerinden biri de bitUSD, bitEUR, bitCNY gibi \n<em>akıllıparalar</em>dır. Kolaylık olsun diye bu varlıklar cüzdan içerisinde USD,EUR,CNY \ndiye kısaltılmışlardır. Bu dijital kuponlar dayandıkları fiziksel varlıkla aynı değeri \ntemsil ederler. Yani bu cüzdandaki 1 USD nin değeri 1 dolardır ve o şekilde \nödenebilir. Bu kuponların hepsinin karşılığı olarak teminat olarak kitli tutulan ve anlık \nfiyatında hesap görümü için mevcut olabilen, <strong>Cybex&#39;in şirket hisseleri (CYB)</strong> \n vardır.</li>\n</ul>\n'},
