/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="kullan-c-s-r-m-aktifler-uia-user-issued-assets-">Kullanıcı Sürümü Aktifler (UIA-User Issued Assets)</h1>\n<p>Daha önce bahsedilen <em>piyasaya sabitli varlıkların</em> yanısıra , Cybex bireylere ve \nşirketlere, hayal edebilecekleri herşeye ait  kendi kuponlarını yaratma ve piyasaya \nsürme imkanı verir. Kullanıcı Sürümü Varlıklar (UIA) için potansiyel kullanım alanları \nsayısızdır. Bir tarafta UIA&#39;ler müşterilerin telefonlarına konser girişlerinde \nkullanabilecekleri basit organizasyon biletleri olarak yüklenebilirler. Diğer tarafta ise \nkitle fonlaması, mülkiyet takibi , ya da hisse şeklinde şirket özsermayesi satışında bile \nkullanılabilirler.</p>\n<p>Tabiiki, her tür kupona uygulanan kurallar çeşitlidir  ve her yetki bölgesinde farklılık \ngösterir. Dolayısıyla Cybex,  varlıklar piyasaya sürülürken , piyasaya süren kişinin \ngeçerli kanunlar çerçevesinde korunmasına yardımcı olacak araçlarla gelir -kanunların \nböyle varlıklara zaten izin verdiğini farz ediyoruz.</p>\n'},
