/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="-zelle-tirilmi-bitaktifler-privatized-bitassets-">Özelleştirilmiş BitAktifler (Privatized BitAssets)</h1>\n<p>Özelleştirilmiş BitAktifler  piyasa-sabitli-aktif çıkarmak isteyen fakat \nfiyatların tanıklar tarafından duyurulmasını istemeyen müşterilere hitab eder. Onun \nyerine, süren kimse <em>özelleştirilmiş</em> bitaktif yaratırken o aktif için özel olarak \nfiyatlarını duyurmaya müsadesi olan bir takım yetkililer belirleyebilir. Süren kimse\naktifle ilgili başka her türlü ücreti belirleyebilir ve kar elde edebilir.</p>\n<p>Bu özellik gerçek-zamanlı fiyatlara erişimi olan ve teşhir ve hacim arttırmak  isteyen \nborsalar ve kuruluşlar için ayrıca ilgi çekicidir.</p>\n'},
