/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<p>[# summary]</p>\n<h3 id="aktif-symbol-">Aktif {symbol}</h3>\n<p>{description}<br>Piyasaya süren {issuer}</p>\n<p>[# annual]</p>\n<p>Eğer ömür-boyu üyelik fazla geliyorsa,  {price} miktarında bir ücret karşılığında bir<br>yıllığına abone olarak gelecek yıl için {feesCashback}% para iadesi alabilirsiniz.\n<img src="/images/logo.png" alt="GitHub Logo"></p>\n<p>[# fee-division]</p>\n<h4 id="-cret-payla-m-">Ücret Paylaşımı</h4>\n<p>{account} adlı hesap her işlem ücreti ödediğinde, o ücret birçok farklı hesaplar arasında \npaylaştırılır. Ağımız {networkFee}% pay alırken, {account} adlı hesabı  getiren Ömür-boyu Üye de  {lifetimeFee}% pay alır.</p>\n<p>{account} adlı hesabın kayıt işlem ücretini ödeyen hesabın adı <em>kayıtçı</em>dır. Kayıtçı geri kalan\n{referrerTotalFee}% miktarı kendileri ve <em>Bağlı Getirici</em> arasında nasıl pay edileceğini kendi belirler.</p>\n<p>{account} adlı hesabın kayıtçısı toplam ücretin {referrerFee}% kadarki kısmını <em>Bağlı Getirici</em> yle paylaşmayı ve {registrarFee}% kadarki kısmını kendine bırakmayı tercih etti.</p>\n<h4 id="bekleyen-cretler">Bekleyen Ücretler</h4>\n<p>{account} adlı hesabın ödediği ücretler her bakım periodu ({maintenanceInterval} seconds) nda sadece ağ, getiriciler ve kayıtçılar arasında paylaştırılır.\nBir sonraki bakım vakti  {nextMaintenanceTime}dır.</p>\n<h4 id="hacizdeki-cretler">Hacizdeki Ücretler</h4>\n<p>Çoğu ücretler anında ödendiği halde {vestingThreshold} miktarını aşan bazı ücretler \n(üyeliğinizi yükseltmek için yada paralı hesap adı kaydı yaptırmak için ödenen) toplam {vestingPeriod} gün hacizde tutulmak zorundadır. </p>\n'},
