/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="hesaplar">Hesaplar</h1>\n<p>Şu ana kadar farkkettiğiniz gibi, bu blokzinciri teknolojisi bir hesap adı kaydetmenizi\nmecbur kılar. Bunun bir çok avantajı vardır : Gelişmiş ölçeklenebilirlik bir yana,\nbiz bu şekilde , kimlik bilgilerini , işlemleri yetkilendiren imzalardan ayırmış oluyoruz.\nUygulamada , <em>bir hesap adına sahip olmak</em>  <em>o hesaba ait fonları</em>  harcayabilmekten \nbağımsızdır. Dahası her iki hak da (biz bunlara <em>izinler</em> diyoruz)  <em>ağırlıklar</em> ve \n<em>eşikler</em> kullanılarak gelişigüzel karmaşık insan ilişkileri (biz bunlara &quot;yetkiler&quot; \ndiyoruz) arasında  paylaştırılabilirler.</p>\n'},
