/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h4 id="-">Содержание</h4>\n<ul>\n<li><a href="index.md">Введение</a></li>\n<li><a href="glossary.md">Глоссарий</a></li>\n<li><a href="introduction/cybex.md">Cybex</a></li>\n<li><a href="introduction/wallets.md">Кошелек</a></li>\n<li><a href="introduction/backups.md">Резервные копии</a></li>\n<li><a href="introduction/blockchain.md">Блокчейн</a></li>\n<li><a href="introduction/witness.md">Делегат</a></li>\n<li><a href="introduction/workers.md">Работники</a></li>\n<li><a href="introduction/committee.md">Член комитета</a></li>\n<li><a href="accounts/general.md">Аккаунты</a></li>\n<li><a href="accounts/permissions.md">Разрешения</a></li>\n<li><a href="accounts/membership.md">Членство</a></li>\n<li><a href="assets/mpa.md">Привязанные к рынку активы</a> (BitUSD, BitEUR, BitGOLD, Bit*,...)</li>\n<li><a href="assets/uia.md">Эмитированные пользователем активы</a></li>\n<li><a href="assets/privbitassets.md">Приватизированные BitAssets</a></li>\n<li><a href="dex/introduction.md">Децентрализованная биржа</a></li>\n<li><a href="dex/trading.md">Торговля</a></li>\n<li><a href="dex/shorting.md">Короткая продажа BitAssets</a></li>\n</ul>\n'},
