/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="-">Кошелек</h1>\n<p>Как Вы уже могли заметить, это веб-приложение, которое работает в браузере. Соединение устанавливается с доверенным узлом сети, который служит шлюзом в остальную часть экосистемы.</p>\n<h2 id="-">Безопасность кошелька</h2>\n<p>Будьте уверены, что наши сервера никогда не получат доступа к Вашим средствам, потому как ни один из Ваших приватных ключей никогда не покидает браузер. Вместо этого они зашифрованы с помощью Вашей фразы-пароля и хранятся в локальной базе данных Вашего браузера. Поэтому Вам следует позаботится о создании соответствующей <a href="../introduction/backups.md">резервной копии</a>, чтобы не потерять доступ к своим средствам из-за взлома компьютера или отказа браузера.</p>\n<h2 id="-">Управление кошельком</h2>\n<p>Кроме того, пользовательский интерфейс способен содержать и предоставлять доступ к нескольким кошелькам, каждый из которых может содержать несколько аккаунтов и соответствующие им средства. Вы можете добавлять, создавать резервную копию и переключаться между существующими кошельками в меню <code>Настройки-&gt;Кошельки</code>.</p>\n'},
/*!***************************************!*\
  !*** ./help/ru/introduction/cybex.md ***!
  \***************************************/
/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="cybex">Cybex</h1>\n<p>Как уже упоминалось, Графен сам по себе - это <em>технология</em> или <em>протокол</em>. Тем не менее, он способен развиться в экосистему только в сочетании с существующим блокчейном, таким как Cybex.</p>\n<p>Cybex создан для того, чтобы распространить инновационность технологии блокчейн во все индустрии, которые используют интернет для предоставления своих услуг. Банки ли это, или фондовые биржи, лотереи, голосование, музыка, аукционы и многие другие сферы, публичный цифровой регистр позволяет создавать децентрализованные автономные компании (т. н. DAC), которые предоставляют сервисы лучшего качества за меньшие деньги в сравнении с их более традиционными, централизованными коллегами. Появление таких децентрализованных компаний возвещает о появлении в организационной структуре новой парадигмы, в которой компании могут работать без управления человеком и под контролем не подверженного коррупции набора правил ведения бизнеса. Эти правила закодированы в публично проверяемом программном обеспечении с открытым исходным кодом, распространенном на компьютерах держателей долей компании, которые без особых усилий защищают компанию от произвольного захвата контроля.</p>\n<p>Cybex делает для бизнеса то, что Биткойн сделал для денег, используя технологию распределенного консенсуса для создания компаний, которые по своей сути глобальны, прозрачны, надежны, эффективны и, что не менее важно, прибыльны.</p>\n<h2 id="-">Данный Кошелек</h2>\n<p>Кошелек, который сейчас открыт в этом окне браузера, позволяет получить доступ ко всем функциям сети Cybex, включая <a href="../assets/mpa.md">BitAssets</a>, <a href="../assets/uia.md">Выпущенные пользователем активы</a> и <a href="../dex/introduction.md">децентрализованную биржу</a>.</p>\n'},
