/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="-graphene">Помощь Graphene</h1>\n<p>Cybex - это платформа Финансовых Смарт-Контрактов, постороенная на технологии <a href="https://github.com/cryptonomex/graphene">Graphene</a>, созданной <a href="http://cryptonomex.com">Cryptonomex</a>. Graphene можно рассматривать как набор инструментов или технологию для создания блокчейнов работающих в режиме реального времени.</p>\n<p>Этот раздел помощи дает краткий обзор и описывает основные понятия этого приложения.</p>\n<h2 id="-">Введение</h2>\n<ul>\n<li><a href="introduction/cybex.md">Cybex</a></li>\n<li><a href="introduction/wallets.md">Кошелек</a></li>\n<li><a href="introduction/backups.md">Резервные копии</a></li>\n<li><a href="introduction/blockchain.md">Блокчейн</a></li>\n<li><a href="introduction/witness.md">Делегаты</a></li>\n<li><a href="introduction/workers.md">Работники</a></li>\n<li><a href="introduction/committee.md">Члены Комитета</a></li>\n</ul>\n<h2 id="-">Аккаунты</h2>\n<ul>\n<li><a href="accounts/general.md">Введение</a></li>\n<li><a href="accounts/permissions.md">Разрешения</a></li>\n<li><a href="accounts/membership.md">Членство</a></li>\n</ul>\n<h2 id="-">Активы</h2>\n<ul>\n<li><a href="assets/mpa.md">Привязанные к рынку активы</a> (BitUSD, BitEUR, BitGOLD, Bit*,...)</li>\n<li><a href="assets/uia.md">Эмитированные пользователем активы</a></li>\n<li><a href="assets/privbitassets.md">Приватизированные BitAssets</a></li>\n</ul>\n<h2 id="-">Децентрализованная биржа</h2>\n<ul>\n<li><a href="dex/introduction.md">Введение</a></li>\n<li><a href="dex/trading.md">Торговля</a></li>\n<li><a href="dex/shorting.md">Короткая продажа BitAssets</a></li>\n</ul>\n<hr>\n<p><a href="glossary.md">Глоссарий</a></p>\n'},
