/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="-">Торговля</h1>\n<p>Эта страница предоставит Вам краткую интерпретацию терминов, используемых на DEX, и информацию о том, как размещаются торговые пары.</p>\n<h2 id="-">Пары</h2>\n<p>На Cybex практически любой актив может торговаться со всеми остальными активами. Как только мы выбрали два актива, обычно мы ссылаемся на определенную <em>рыночную пару</em>. Например, мы можем торговать USD против EUR в паре USD:EUR.</p>\n<p>В целях установки ориентира, мы будем использовать общие термины <em>базовый</em> и <em>котируемый</em>, где подобные пары представлены как</p>\n<pre><code>&quot;котируемый&quot; : &quot;базовый&quot;</code></pre><p>and for instance with <em>base</em> being USD and <em>quote</em> being EUR, denote the EUR:USD pair.</p>\n<h2 id="-">Регистр Ордеров</h2>\n<p>Регистр состоит из цен <em>покупки</em> и цен <em>продажи</em>. Так как стороны торговых пар не фиксированы и могут меняться, следующая таблица даст Вам представление о ценах покупки и продажи в соответствии с продаваемым/покупаемым лотом для каждого случая:</p>\n<table>\n<thead>\n<tr>\n<th>Сторона</th>\n<th>Продажа</th>\n<th>Покупка</th>\n</tr>\n</thead>\n<tbody><tr>\n<td>Цена Покупки</td>\n<td><em>котируемый</em></td>\n<td><em>базовый</em></td>\n</tr>\n<tr>\n<td>Цена Продажи</td>\n<td><em>базовый</em></td>\n<td><em>котируемый</em></td>\n</tr>\n<tr>\n<td>----------</td>\n<td>-------</td>\n<td>-------</td>\n</tr>\n</tbody></table>\n<p>Естественно, цена покупки пары USD:EUR является ценой продажи обратной пары EUR:USD. Конечно, цены внутри представлены в виде фракций, а потому результаты в обеих парах будут идентичны.</p>\n<h2 id="-">Торговля</h2>\n<p>Чтобы разместить торговый ордер, Вам нужно заполнить форму либо <em>покупки</em>, либо <em>продажи</em>, а также определить <em>цену</em> и <em>количество</em> покупаемого/продаваемого актива. Вам нужно будет определить <em>цену</em> и <em>количество</em> покупаемого/продаваемого актива. Стоимость ордера будет рассчитана автоматически. Обратите внимание, что для размещения ордера нужно будет заплатить дополнительную комиссию.</p>\n<p>Как только ордер будет исполнен (т.е. кто-то купил/продал Ваше предложение), на Ваш аккаунт будет переведен соответствующий актив.</p>\n<p>Неисполненные ордера могут быть отменены в любой момент.</p>\n'},
