/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="-bitassets">Короткая продажа BitAssets</h1>\n<p>Для увеличения Вашего воздействия на CYB и увеличения ликвидности активов BitAssets, таких как USD, EUR, GOLD и др., Вы можете <em>занять</em> этот актив bitAsset у сети и <em>выставить шорт</em>. Здесь мы кратко опишем данную процедуру.</p>\n<h2 id="-">Заём</h2>\n<p>Сеть Cybex способна создавать любое количество каждого актива BitAsset и занимать его субьектам экосистемы при условии предоставления достаточного залога.</p>\n<ul>\n<li><em>расчетная цена</em>: Цена за 1 CYB взятая с внешних бирж.</li>\n<li><em>уровень обеспечивающего залога</em> (MCR): Размер залога, определённый участниками рынка как минимальный</li>\n<li><em>максимальный размер сжатия шорта</em> (MSQR): Установленный участниками рынка размер вынужденной покупки актива медведями по высокому курсу из опасения еще большего его роста</li>\n<li><em>защита от сжатия шорта</em>(SQP): Определяет предельную величину принудительного покрытия позиции </li>\n<li><em>черта марджин колла</em> (CP): Цена, при которой шорт будет принудительно закрыт</li>\n</ul>\n<h3 id="-">Марджин Колл</h3>\n<p>Сеть Cybex способна применять марджин колл к тем позициям, которые не имеют достаточного обеспечения для покрытия одолженных ими bitAssets. Марджин колл будет происходить каждый раз, когда самая высокая ставка окажется меньше, чем <em>цена досрочного выкупа</em> и больше <em>SQP</em>. Маржинальная позиция будет вынуждена продавать своё залоговое обеспечение каждый раз, когда самое высокое предложение на покупку обеспечения будет меньше, чем цена дострочного выкупа (x/CYB).</p>\n<pre><code>SQP        = расчетная цена / MSQR\nцена дострочного выкупа = DEBT / COLLATERAL * MCR</code></pre><p>Марджин колл возьмет обеспечение, выкупит доли одолженных bitAsset на уровне рынка до SQP и закроет позицию. Оставшиеся CYB залогового обеспечения вернутся к клиенту.</p>\n<h3 id="-">Погашение</h3>\n<p>Держатели любого bitAsset могут запросить расчет по <em>справедливой цене</em> в любой момент. Расчет закрывает заемные/шорт позиции с самым низким уровнем обеспечивающего залога и продает залог для расчета.</p>\n<h2 id="-">Продажа</h2>\n<p>После заёма bitAssets Вы можете свободно продавать их на любых соответствующих рынках по любой цене, какую будет готов заплатить покупатель. После этого шага короткая продажа считается завершенной и Вы произвели шорт с этим конкретным bitAsset.</p>\n<h2 id="-">Обновление обеспечивающего залога</h2>\n<p>В любой момент держатель заемной/шорт позиции может изменить обеспечивающий залог в стремлении гибко подстроиться под поведение рынка. Если обеспечивающий залог увеличится, дополнительное количество CYB будет заморожено в качестве залога, тогда как уменьшение обеспечивающего залога потребует выплаты соответствующего количества BitAsset обратно сети.</p>\n<h2 id="-">Покрытие</h2>\n<p>Чтобы закрыть заемную/шорт позицию нужно обладать одолженным количеством этого конкретного bitAsset, чтобы передать его сети Cybex. После этого BitAssets снимаются с соответствующего запаса, а залог освобождается и отправляется обратно владельцу.</p>\n'},
