/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="-">Децентрализованная биржа</h1>\n<p>Децентрализованная биржа (далее обозначается как <em>DEX</em>) позволяет производить прямой обмен цифровых товаров, торгующихся в экосистеме Cybex.</p>\n<p>Децентрализованная биржа обладает весьма определенным набором преимуществ перед традиционными централизованными биржами, о чем мы хотим кратко рассказать ниже. И хотя Cybex DEX включает в себя их все, право использовать эти функции полностью или частично остается за читателем и клиентом.</p>\n<ul>\n<li><p><strong>Разделение сил</strong>: Нет такой причины, которая бы обязывала одну и ту же единицу быть ответственной и за выдачу IOU, и за обработку книги ордеров. В Cybex подбор ордеров производится протоколом, который не знает о последствиях, касающихся связанных с ними активов.</p>\n</li>\n<li><p><strong>Единая Общая Книга Ордеров</strong>: Так как Cybex глобальна, любой, у кого есть Интернет, может использовать DEX для торговли. Это делает всю ликвидность мира доступной единственной книге ордеров для децентрализованной торговли.</p>\n</li>\n<li><p><strong>Торгуй чем угодно</strong>: Cybex DEX - агностик в отношении активов. А значит, Вы можете торговать на <strong>любой</strong> паре. И хотя ликвидность некоторых пар в итоге окажется низкой, как у SILVER:GOLD, другие пары, вроде USD:EUR для торговли на FOREX, будут обладать внушительным объемом.</p>\n</li>\n<li><p><strong>Без ограничений</strong>: Протокол Cybex не в состоянии ограничить Ваш торговый опыт.</p>\n</li>\n<li><p><strong>Децентрализованная</strong>: DEX децентрализована по всему миру. Это не только означает, что не существует ни единого отказа, но и позволяет бирже Cybex работать 24/7, так как где-нибудь на планете всегда день.</p>\n</li>\n<li><p><strong>Безопасная</strong>: Безопасность Ваших средств и торгов обеспечивается эллиптической криптографией промышленного уровня. Никто не сможет получить доступ к Вашим средствам, пока Вы им не позволите. Чтобы возвести безопасность на новый уровень, мы позволяем нашим клиентам устанавливать escrow и схемы с мульти-подписью.</p>\n</li>\n<li><p><strong>Быстрая</strong>: В отличие от других децентрализованных сетей, Cybex DEX позволяет торговать в реальном времени, ограничиваясь только скоростью света и размером планеты.</p>\n</li>\n<li><p><strong>Доказуемый алгоритм подбора ордеров</strong>: Что делает Cybex DEX поистине уникальной, так это доказуемый алгоритм подбора ордеров. Получив набор ордеров, Вы всегда сможете доказуемо проверить, что эти ордера были подобраны правильно.</p>\n</li>\n<li><p><strong>Обеспеченные Smartcoins</strong>: Одно из самых больших новшеств Cybex - это <em>smartcoins</em>, такие как bitUSD, bitEUR, bitCNY и другие. Ради удобства эти активы обозначены просто как USD, EUR, CNY и т. д. в кошельке. Эти цифровые токены обладают той же ценностью, что и прикрепленные к ним физические активы. Поэтому 1 USD в таком кошельке стоит $1 и может использоваться как таковой. Любой из этих токенов обеспечен долями компании Cybex (CYB), которые заморожены в качестве обеспечения залога и доступны для сделок по своей текущей цене.</p>\n</li>\n</ul>\n'},
