/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h3 id="-">Голосование</h3>\n<p>Голосование в Cybex крайне важно как для безопасности, так и для развития сети. Голосование определяет, какие Заверители избраны для поддержания работы сети, какие Члены Комитета обладают способностью голосовать за важные изменения и какие Предлагаемые Работники приняты для улучшения и расширения функционала.</p>\n<p>Если же Вы не понимаете различные приведенные выше роли в полной мере, Вы можете выбрать вариант делегирования Вашей силы голоса Прокси, который будет голосовать от Вашего имени. Если Вы решите использовать Прокси, Вы не сможете самостоятельно голосовать за Заверителей, Членов Комитета и Предлагаемых Работников. Вы всегда можете освободить вашу силу голоса из Прокси после, если решите в принимать участие в процессе голосования в полной мере.</p>\n<p><strong>Не забудьте нажать &quot;Опубликовать изменения&quot; после того, как вы сделали свой выбор.</strong></p>\n'},
