/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<p>Разрешения владельца определяют кто распоряжается аккаунтом. Владельцы могут переписывать все ключи и менять любые настройки аккаунта.</p>\n<p>Для получения подробной информации смотрите раздел <a href="accounts/permissions">разрешения</a>.</p>\n'},
/*!***********************************************!*\
  !*** ./help/ru/components/AccountPermMemo.md ***!
  \***********************************************/
/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports="<p>Мемо ключ - это место, где Вы получаете мемо. Чтобы расшифровать мемо, Вы должны контролировать приватный ключ для публичного ключа.</p>\n<p>Используя пару из публичного/приватного ключей без разрешения на трату средств, Вы можете дать доступ к Вашим мемо в режиме &quot;только чтение&quot; третьим сторонам.</p>\n"},
/*!*************************************************!*\
  !*** ./help/ru/components/AccountPermActive.md ***!
  \*************************************************/
/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<p>Активные разрешения определяют аккаунты, которые имеют разрешение тратить средства этого аккаунта.</p>\n<p>Они могут быть использованы для упрощенной настройки схемы с мульти-подписью, смотрите раздел <a href="accounts/permissions">разрешения</a> чтобы узнать подробности.</p>\n'},
/*!*************************************************!*\
  !*** ./help/ru/components/AccountMembership.md ***!
  \*************************************************/
/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<p>[# пожизненно]</p>\n<h3 id="-feescashback-">Получите {feesCashback}% кэшбэка с комиссий</h3>\n<p>Пожизненные члены получают {feesCashback}% кэшбэка с каждой комиссии за транзакцию, которую они оплачивают, и имеют право получать реферальный доход от пользователей, которых они регистрируют, или рефереров сети. Пожизненное членство стоит всего {price}.</p>\n<p>[# разделение-комиссии]</p>\n<h4 id="-">Разделение Комиссии</h4>\n<p>Каждый раз, когда {account} платит комиссию за транзакцию, эта комиссия делится между разными аккаунтами. Сеть забирает долю в {networkFee}%, и Пожизненный Член, рефералом которого является {account}, получает долю в {lifetimeFee}%.</p>\n<p><em>Регистратор</em> - это аккаунт, который заплатил комиссию за регистрацию {account} в сети. Регистратор должен решить, как разделить оставшиеся {referrerTotalFee}% между ним и его собственной <em>Аффилированной Партнерской</em> программой.</p>\n<p>Регистратор {account} а решил отдать {referrerFee}% от суммы комиссии <em>Аффилированному Рефереру</em> и оставить {registrarFee}% от суммы комиссии себе.</p>\n<h4 id="-">Ожидаемые комиссии</h4>\n<p>Комиссии, оплаченные {account}, разделяются только между сетью, реферерами и регистраторами один раз в каждый период обслуживания ({maintenanceInterval} секунд). Следующее время обслуживания {nextMaintenanceTime}.</p>\n<h4 id="-">Вестинговые комиссии</h4>\n<p>Большинство комиссий доступны немедленно, но комиссии за {vestingThreshold} (такие как комиссия за повышение уровня Вашего членства или регистрацию премиум-имени аккаунта) должны ожидать обработки {vestingPeriod} дней.</p>\n'},
