/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports="<p>[# разрешения] Разрешения определяют доступные для актива функции. Однако, даже если функция разрешена, она по-прежнему должна быть активирована с помощью соответствующего маркера, чтобы она исполнялась блокчейном.</p>\n<p>После создания Вы можете только удалить данное разрешение, Вы не можете включить разрешение, которое было отключено при создании.</p>\n<p>[# маркеры] Маркеры определяют, какие функции активов являются активными или неактивными. Они могут быть включены и отключены владельцем актива в любое время.</p>\n"},
/*!*******************************!*\
  !*** ./help/ru/assets/uia.md ***!
  \*******************************/
/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="-">Эмитированные пользователем активы</h1>\n<p>Помимо вышеупомянутых <em>привязанных к рынку</em> активов, Cybex позволяет отдельным лицам и компаниям создавать и выпускать свои собственные токены для всего, что они только могут себе представить. Потенциальные варианты использования для так называемых эмитированных пользователем активов (User Issued Assets - UIA) не поддаются исчислению. С одной стороны, такие активы можно использовать в качестве обычных входных билетов, хранящихся на мобильном телефоне пользователя, чтобы облегчить вход на концерт. С другой стороны, они могут использоваться для краудфандинга, отслеживания владения или даже для продажи доли компании в форме акций.</p>\n<p>Очевидно, правила, применимые к каждому виду токенов, сильно отличаются и зачастую варьируются в каждой отдельной юрисдикции. Таким образом, Cybex располагает инструментами, которые позволяют эмитентам соответствовать всем применяемым правилам при выпуске активов с тем условием, что регуляторы изначально позволяют такие активы.</p>\n'},
/*!*****************************************!*\
  !*** ./help/ru/assets/privbitassets.md ***!
  \*****************************************/
/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="-bitassets">Приватизированные BitAssets</h1>\n<p>Приватизированные BitAssets обслуживают тех клиентов, которые хотели бы выпустить актив с привязкой к рынку, но не хотели бы, чтобы делегаты публиковали его цены. Вместо этого, когда клиент создает <em>приватизированный</em> bitasset, он может определять набор авторитетов, которые смогут публиковать цену для этого конкретного актива. Эмитент также может определить все виды комиссий, связанных с этим активом, и получать прибыль.</p>\n<p>Эта функция представляет особый интерес для бирж и институтов, которые имеют доступ к ценам в режиме реального времени и хотели бы увеличить видимость и объем.</p>\n'},
/*!*******************************!*\
  !*** ./help/ru/assets/mpa.md ***!
  \*******************************/
/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="-">Привязанные к рынку активы</h1>\n<p>Криптовалюта со свойствами и преимуществами Биткойна, которая способна поддерживать паритет цен с глобально принятой валютой (например, долларом США), может широко использоваться для удобной и устойчивой к цензуре торговли. Это может быть достигнуто с помощью привязанных к рынку активов (market pegged assets - MPA) от Cybex, нового типа свободно торгуемых цифровых активов, чья стоимость привязана к стоимости обычного базового актива посредством контрактов на разницу цен (CFD).</p>\n<p><em>SmartCoin</em> (синоним MPA) - это криптовалюта, которая <em>всегда</em> имеет 100% или более своей стоимости обеспеченной основной валютой Cybex (CYB), на которую она может быть обменяна в любой момент, в качестве <em>залога</em> в CFD.</p>\n<p>Такими уникальными MPA делает их независимость от риска партнеров, даже несмотря на то, что они имеют сходство с CFD, подкрепленными залогом. Этого можно достичь с помощью предоставления сети возможности (реализованной как протокол программного обеспечения) самой быть ответственной за обеспечение залога и проведение сделок, как более подробно описано ниже.</p>\n<p>Это подгруппа доступных привязанных к рынку активов:</p>\n<ul>\n<li>BitUSD</li>\n<li>BitCNY</li>\n<li>BitEUR</li>\n<li>BitGOLD</li>\n<li>...</li>\n</ul>\n'},
