/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="cybex-">Cybexについて</h1>\n<p>Cybexは<a href="http://cryptonomex.com">Cryptonomex</a>が開発した<a href="https://github.com/cryptonomex/graphene">Graphene</a>をベースとした金融スマートコントラクトプラットフォームです。\nGrapheneは開発者用のツールキットやリアルタイムのブロックチェーン技術です。</p>\n<p>ここではCybexの基本的な概念を説明します。</p>\n<h2 id="-">導入</h2>\n<ul>\n<li><a href="introduction/cybex.md">Cybex</a></li>\n<li><a href="introduction/wallets.md">ウォレット</a></li>\n<li><a href="introduction/backups.md">バックアップ</a></li>\n<li><a href="introduction/blockchain.md">ブロックチェーン</a></li>\n<li><a href="introduction/witness.md">承認者</a></li>\n<li><a href="introduction/workers.md">労働者</a></li>\n<li><a href="introduction/committee.md">委員会メンバー</a></li>\n</ul>\n<h2 id="-">アカウント</h2>\n<ul>\n<li><a href="accounts/general.md">作成</a></li>\n<li><a href="accounts/permissions.md">権限</a></li>\n<li><a href="accounts/membership.md">会員</a></li>\n</ul>\n<h2 id="-">資産</h2>\n<ul>\n<li><a href="assets/mpa.md">ペッグ通貨</a></li>\n<li><a href="assets/uia.md">ユーザ発行通貨</a></li>\n<li><a href="assets/privbitassets.md">非公開のBitAssets</a></li>\n</ul>\n<h2 id="-">分散型取引所</h2>\n<ul>\n<li><a href="dex/introduction.md">取引所について</a></li>\n<li><a href="dex/trading.md">取引方法</a></li>\n<li><a href="dex/shorting.md">BitAssetsの空売り</a></li>\n</ul>\n<hr>\n<p><a href="glossary.md">用語集</a></p>\n'},
