/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="accounts">Accounts</h1>\n<p>すでにお気づきだと思いますが、CYBEXではアカウント名の登録が必要となります。\nこれにはスケーラビリティの向上に加え、IDとトランザクションの認証を独立させる等の多くの利点があります。\n実際にアカウントを所有することと資金を使用することは独立しており、これらの権利（<em>パーミッション</em>）は<em>重み</em>と<em>閾値</em>を付けて任意の複数人に（<em>権限</em>）分割することができます。</p>\n'},
