/*!**************************************************!*\
  !*** ./help/en/introduction/bridges_gateways.md ***!
  \**************************************************/
/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h2 id="bridge-and-gateway-services">Bridge and gateway services</h2>\n<p>Both bridges and gateways allow you to deposit and withdraw coins, but there is a difference in the amount of trust you need to place in the service providers.</p>\n<h3 id="bridges-trust-free-model">Bridges: trust-free model</h3>\n<p>A bridge service provides a way to deposit an amount of a crypto-currency other than Cybex, and in turn receive a SmartCoin equivalent. SmartCoins have no counterparty risk, so the only risk you experience when using a bridge is during the short time it takes to complete the transfer. This is better than a centralized exchange such as Poloniex, where you are always at risk of the exchange being hacked, going bankrupt, or experiencing any number of other issues.</p>\n<h3 id="gateways-trust-based-model">Gateways: trust-based model</h3>\n<p>Gateways are basically equivalent to the standard exchange model where you depend on the solvency of the exchange to be able to redeem your coins. Generally gateways issue assets prefixed with their symbol, like OPEN, TRADE, or META. These assets are backed 100% by the real BTC or ETH or any other coin that people deposit with the gateways.</p>\n<p>An OPEN.BTC is thus in theory equivalent to the BTC you get on Poloniex, which could be prefixed POLO.BTC. In both cases you rely on the service provider, CCEDK for OPEN. assets and Poloniex for POLO. assets, to remain solvent in order to back the value of the assets they&#39;ve issued. Because gateways only provide this one service which is normally only one part of running an exchange, one might even argue that they have an easier job of securing their holdings.</p>\n'},
/*!********************************************!*\
  !*** ./help/en/introduction/blockchain.md ***!
  \********************************************/
/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="blockchain">Blockchain</h1>\n<p>As most crypto currencies, Graphene makes use of a blockchain to update\nparticipants about transfers and market activities. Since blocks always refer to\nthe previous block, we get a chain of blocks (blockchain) that contains all\ntransactions every made in the network. Because the blockchain is a publicly\naccessible and auditable ledger, everyone can take a closer look and verify\ntransfers as well as market orders and order books.</p>\n<p>Of course, this web wallet offers a block explorer to assist you with your\naudit.</p>\n<h2 id="consensus-mechanism">Consensus Mechanism</h2>\n<p>Who exactly is allows to <em>produce</em> a block at which time instant is defined by a\nconsensus mechanism called <em>Delegated Proof of Stake</em>. In essence, the\nshareholders of Cybex (holders of the CYB token) can cast a vote for their\npreferred block producers on the blockchain. Those so called <em>witnesses</em> with\nthe most votes are allowed to produce blocks.</p>\n<h2 id="transactions">Transactions</h2>\n<p>The Graphene blockchain technology offers a variety of transaction types. Users\nare not only able to simply transfer assets between each other, but there are\nalso transactions to interact with the decentralized exchange. Most of these\ntransaction types are labeled with a self-explaining tag, others require more\nknowledge about the inner workings of the company.</p>\n'},
/*!*****************************************!*\
  !*** ./help/en/introduction/backups.md ***!
  \*****************************************/
/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="backups">Backups</h1>\n<h2 id="local-wallet">Local Wallet</h2>\n<p>It is recommended to make regular backups of your Local Wallet even though in most\ncases a single backup may be sufficient. Please note that in order to recover\nfrom a backup you will also need to provide the passphrase (password) because <strong>backups\nare encrypted</strong>. Hence, if you either lose your wallet or your passphrase you\nwill be unable to access any of your funds again!</p>\n<p>You can create a backup from <a href="/settings">Settings -&gt; Backup</a>.</p>\n<ul>\n<li>Store this backup in at least two secure locations only accessible by you</li>\n<li>The backup is encrypted with your passphrase/password so do not store your passwrod in the same location</li>\n</ul>\n<h2 id="advanced-users-only">Advanced Users Only</h2>\n<h3 id="brainkey">Brainkey</h3>\n<blockquote>\n<p>If you never manually imported an account key into your wallet, you can\nalternatively backup your accounts and their funds by exporting the <em>brainkey</em>,\na string of words from which your keys are derived deterministically.</p>\n</blockquote>\n<p>Remark: Hierarchical Authorities (advanced uses ONLY)</p>\n<blockquote>\n<p>If you are using hierarchical authorities (account and/or active permissions),\nbacking up your keys alone may not be sufficient to regain access to your funds!\nPlease revise the documentations about hierarchical authorities.</p>\n</blockquote>\n'},
