/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<p>[# lifetime]</p>\n<h3 id="get-feescashback-cashback-on-fees">Get {feesCashback}% Cashback on Fees</h3>\n<p>Lifetime Members get {feesCashback}% cashback on every transaction fee they pay and\nqualify to earn referral income from users they register with or refer to the network. A Lifetime Membership is just {price}.</p>\n<p>[# fee-division]</p>\n<h4 id="fee-division">Fee Division</h4>\n<p>Every time {account} pays a transaction fee, that fee is divided among several different accounts.  The network takes\na {networkFee}% cut, and the Lifetime Member who referred {account} gets a {lifetimeFee}% cut.</p>\n<p>The <em>registrar</em> is the account that paid the transaction fee to register {account} with the network.  The registrar gets to decide how to\ndivide the remaining {referrerTotalFee}% between themselves and their own <em>Affiliate Referrer</em> program.</p>\n<p>{account}&#39;s registrar chose to share {referrerFee}% of the total fee with the <em>Affiliate Referrer</em> and keep {registrarFee}% of the total fee for themselves.</p>\n<h4 id="pending-fees">Pending Fees</h4>\n<p>Fees paid by {account} are divided among the network, referrers, and registrars once every maintenance interval ({maintenanceInterval} seconds). The\nnext maintenance time is {nextMaintenanceTime}.</p>\n<h4 id="vesting-fees">Vesting Fees</h4>\n<p>Most fees are made available immediately, but fees over {vestingThreshold}\n(such as those paid to upgrade your membership or register a premium account name) must vest for a total of {vestingPeriod} days.</p>\n'},
