/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="accounts">Accounts</h1>\n<p>As you may have already noticed by now, this blockchain technology requires you\nto register an account name. This comes with many advantages: Besides improved\nscalability, we have separated the identity from the transaction authorizing\nsignature. In practice, <em>owning an account name</em> is independent from being able\nto <em>spend its funds</em>. Furthermore, both rights (we call them <em>permissions</em>) can\nsplit among an arbitrary complex relation of people (we call them <em>authorities</em>)\nusing <em>weights</em> and a required <em>thresholds</em>.</p>\n'},
